import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Price Range" filter by its heading text
    const priceFilterHeader = await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Use XPath to get the parent .price-filter container
    const [priceFilterContainer] = await page.$x("//h4[contains(text(),'Price Range')]/parent::*");
    if (!priceFilterContainer) throw new Error('Price filter container not found');

    // Find the Min and Max price inputs using placeholder attribute within the container
    const minInput = await priceFilterContainer.$('input[placeholder="Min"]');
    const maxInput = await priceFilterContainer.$('input[placeholder="Max"]');
    if (!minInput || !maxInput) throw new Error('Price input fields not found');

    // Clear and set new values
    await minInput.click({ clickCount: 3 });
    await minInput.fill('100');
    await maxInput.click({ clickCount: 3 });
    await maxInput.fill('500');

    // Take screenshot after filling inputs
    const filledShot = path.join(screenshotsDir, 'step_2_filled_inputs.png');
    await page.screenshot({ path: filledShot });
    screenshots.push(filledShot);

    // Find and click the Apply button using its text
    const applyButton = await priceFilterContainer.$('button:has-text("Apply")');
    if (!applyButton) throw new Error('Apply filter button not found');
    await applyButton.click();

    // Wait for some visible effect: look for a notification or updated product grid
    // Wait for a notification with the price range text (success or info)
    await page.waitForSelector(`.notification:has-text("$100 - $500")`, { timeout: 5000 });

    // Take screenshot after applying filter
    const appliedShot = path.join(screenshotsDir, 'step_3_applied_filter.png');
    await page.screenshot({ path: appliedShot });
    screenshots.push(appliedShot);

    // Extract the price values from the inputs to verify
    const minValue = await minInput.inputValue();
    const maxValue = await maxInput.inputValue();

    // Optionally, extract the number of products shown after filter
    let productCount = null;
    const resultsCountElem = await page.$('.results-count');
    if (resultsCountElem) {
      const text = await resultsCountElem.textContent();
      const match = text && text.match(/(\d+)/);
      if (match) productCount = parseInt(match[1], 10);
    }

    return {
      success: true,
      action: "Applied price range filter ($100 - $500) and verified UI update",
      extractedData: {
        minPrice: minValue,
        maxPrice: maxValue,
        filteredProductCount: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
